import React from "react";

const container = props => {
    const styles = {
        width: "100%", 
        maxWidth: "60rem", 
        margin: "auto"
    };
    return (
        <div className="jumbotron" style={styles}>
            {props.children}
        </div>
    );
};

export default container;
